import OFTBLogo from "../../img/inverted.jpg";
import TopMenuStyles from "./TopMenu.module.css";
const TopMenu = () => {
    return (
        <div className={TopMenuStyles.topMenu}>
           <div className={TopMenuStyles.logoWrapper}>
                <img src={OFTBLogo} className={TopMenuStyles.logo} />
           </div>
           <div>
            <button>Get Yours!</button>
           </div>
        </div>
    );
}
export default TopMenu;
